import React from "react";
import "./navbar.css";
import Logo from '../../assets/navbarLogo.png'
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar-content">
        <div className="navbar-logo"><img src={Logo} alt="logo" /></div>
        <div className="navbar-nav">
          <Link to="/login" className="navbar-link">About</Link>
          <div className="navbar-link">Events</div>
          <div className="navbar-link">Advice</div>
          <div className="navbar-link">Gallery</div>
        </div>
        <div className="navbar-profile">
            <Link to="/login" className="navbar-login">Log in</Link>
            <Link to="/signup" className="navbar-signup">Sign up</Link>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
